{"post_stream":{"posts":[{"id":3394482,"name":"SLAB-Mr.Thomas","username":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png","created_at":"2024-06-02T18:33:17.181Z","cooked":"<p>I have many <code>Time</code> variables that ideally are in an array such as</p>
<pre><code class="lang-auto">Measure&lt;Time&gt;[] myTimes = new Measure&lt;Time&gt;[100];
</code></pre>
<p>This has compiler error <code>Cannot create a generic array of Measure&lt;Time&gt;</code>.</p>
<p>Is there syntax that comes close to this for my usage or would I have to make a double[100] and forget storing the <code>Measure</code>?</p>","post_number":1,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T18:33:17.181Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":37,"reads":256,"readers_count":255,"score":236.2,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"SLAB-Mr.Thomas","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":24594,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/1","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null,"can_vote":false},{"id":3394488,"name":"Fletch","username":"Fletch1373","avatar_template":"/user_avatar/www.chiefdelphi.com/fletch1373/{size}/220073_2.png","created_at":"2024-06-02T18:45:25.180Z","cooked":"<p>I don’t believe you can do native arrays of generic types like that.  You should be able to use any generic type though.  <code>ArrayList&lt;Measure&lt;Time&gt;&gt;</code> would probably do what you need though</p>","post_number":2,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T18:45:25.180Z","reply_count":1,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":0,"reads":254,"readers_count":253,"score":130.8,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"Fletch","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[{"id":2,"count":5}],"moderator":false,"admin":false,"staff":false,"user_id":9105,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"3181/3015 Mentor | 213/1373 Alum | CSA/FTAA/Jack-of-all-Trades"},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/2","custom_user_title":"3181/3015 Mentor | 213/1373 Alum | CSA/FTAA/Jack-of-all-Trades","reactions":[{"id":"heart","type":"emoji","count":5}],"current_user_reaction":null,"reaction_users_count":5,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3394496,"name":"SLAB-Mr.Thomas","username":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png","created_at":"2024-06-02T19:13:31.486Z","cooked":"<p>Making the <code>ArrayList</code> does work and is close to an array but I don’t know how to fill the array list with a lot of <code>Measure&lt;Time&gt;</code> objects because the <code>Measure&lt;Time&gt;</code> cannot be instantiated. How do I mass produce 100 objects for the list? This doesn’t work:</p>
<pre><code class="lang-auto">       for (int i = 0; i &lt; 99; i++) {
            myTimes.add(i, new Measure&lt;Time&gt;());
        }
</code></pre>
<p><code>Cannot instantiate the type Measure&lt;Time&gt;</code></p>
<p>This works but it isn’t the shortcut I’m looking for:</p>
<pre><code class="lang-auto">Measure&lt;Time&gt; time0;
myTimes.add(0, time0);
...
Measure&lt;Time&gt; time99;
myTimes.add(99, time99);
</code></pre>
<p>A possibility I’m not fond of is call a method 100 times that returns a <code>Measure&lt;Time&gt;</code>.</p>","post_number":3,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T19:18:33.376Z","reply_count":2,"reply_to_post_number":2,"quote_count":0,"incoming_link_count":1,"reads":223,"readers_count":222,"score":59.6,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"SLAB-Mr.Thomas","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":2,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":9105,"username":"Fletch1373","name":"Fletch","avatar_template":"/user_avatar/www.chiefdelphi.com/fletch1373/{size}/220073_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":24594,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/3","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3394500,"name":"Fletch","username":"Fletch1373","avatar_template":"/user_avatar/www.chiefdelphi.com/fletch1373/{size}/220073_2.png","created_at":"2024-06-02T19:44:31.433Z","cooked":"<p>This is starting to feel like a bit of an XY Problem.</p>
<p>Perhaps you could explain what youre trying to do at a higher level.  Why do you need all the objects in the array pre-filled?</p>","post_number":4,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T19:44:31.433Z","reply_count":0,"reply_to_post_number":3,"quote_count":0,"incoming_link_count":0,"reads":179,"readers_count":178,"score":35.8,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"Fletch","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":24594,"username":"SLAB-Mr.Thomas","name":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":9105,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"3181/3015 Mentor | 213/1373 Alum | CSA/FTAA/Jack-of-all-Trades"},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/4","custom_user_title":"3181/3015 Mentor | 213/1373 Alum | CSA/FTAA/Jack-of-all-Trades","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3394501,"name":"Matt Soucy (he/him)","username":"msoucy","avatar_template":"/user_avatar/www.chiefdelphi.com/msoucy/{size}/237623_2.png","created_at":"2024-06-02T19:47:19.819Z","cooked":"<p>In your “it works”, your <code>time0</code> is actually initialized to <code>null</code>, not to a new object. You can’t create a new <code>Measure&lt;Time&gt;</code> because <code>Measure</code> is an interface - you need a class that <code>implements Measure</code> in order to instantiate it.</p>","post_number":5,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T19:47:19.819Z","reply_count":2,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":0,"reads":170,"readers_count":169,"score":59.0,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"Matt Soucy (he/him)","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":11822,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"166 Chop Shop (Software Mentor)"},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/5","custom_user_title":"166 Chop Shop (Software Mentor)","reactions":[{"id":"heart","type":"emoji","count":1},{"id":"open_mouth","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":2,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3394504,"name":"SLAB-Mr.Thomas","username":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png","created_at":"2024-06-02T19:57:02.937Z","cooked":"<p>Yes. This should create 100 different objects other than <code>null</code></p>
<pre><code class="lang-auto">for (int i = 0; i &lt; 100; i++) {
    fillMeasure();
}

private void fillMeasure() {
  var time = Units.Seconds.of(0.);
  myTimes.add(time);
}
</code></pre>
<p>Sorry about <code>XY-like</code>. It is an existing contrived example that was easy with “myTimes” as <code>long</code> milliseconds but I decided to <code>get-with-the-program</code> and use <code>Measure&lt;Time&gt;</code>.</p>","post_number":6,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T19:58:36.749Z","reply_count":1,"reply_to_post_number":5,"quote_count":0,"incoming_link_count":0,"reads":161,"readers_count":160,"score":37.2,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"SLAB-Mr.Thomas","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":11822,"username":"msoucy","name":"Matt Soucy (he/him)","avatar_template":"/user_avatar/www.chiefdelphi.com/msoucy/{size}/237623_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":24594,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/6","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3394510,"name":"Fletch","username":"Fletch1373","avatar_template":"/user_avatar/www.chiefdelphi.com/fletch1373/{size}/220073_2.png","created_at":"2024-06-02T20:11:13.891Z","cooked":"<p>Heres an old docs link for Collections.fill() which might meet your needs.</p>
<p><a href="https://docs.oracle.com/javase%2F7%2Fdocs%2Fapi%2F%2F/java/util/Collections.html#fill(java.util.List,%20T)" class="onebox" target="_blank" rel="noopener nofollow ugc">https://docs.oracle.com/javase%2F7%2Fdocs%2Fapi%2F%2F/java/util/Collections.html#fill(java.util.List,%20T)</a></p>
<p>Caveat that I believe it would be all the same referenced object, so not as useful if you need mutability.</p>","post_number":7,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T20:11:42.825Z","reply_count":0,"reply_to_post_number":6,"quote_count":0,"incoming_link_count":0,"reads":145,"readers_count":144,"score":29.0,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"Fletch","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"link_counts":[{"url":"https://docs.oracle.com/javase%2F7%2Fdocs%2Fapi%2F%2F/java/util/Collections.html#fill(java.util.List,%20T)","internal":false,"reflection":false,"title":"Collections (Java Platform SE 7 )","clicks":1}],"read":true,"user_title":"","reply_to_user":{"id":24594,"username":"SLAB-Mr.Thomas","name":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png"},"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":9105,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"3181/3015 Mentor | 213/1373 Alum | CSA/FTAA/Jack-of-all-Trades"},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/7","custom_user_title":"3181/3015 Mentor | 213/1373 Alum | CSA/FTAA/Jack-of-all-Trades","reactions":[{"id":"point_up","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3394540,"name":"SLAB-Mr.Thomas","username":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png","created_at":"2024-06-02T22:11:53.446Z","cooked":"<p>Thanks to <a class="mention" href="/u/msoucy">@msoucy</a> and <a class="mention" href="/u/fletch1373">@Fletch1373</a> for keeping me going on <code>Measure</code>. I was able to update my allwpilib PR Command-Based Best Practices Java examples to use <code>Measure&lt;Time&gt;</code> instead of <code>long</code>, etc. (Yes a beginner writing best-practices does seem a bit perverse but I tested the program and it works. Someone here encouraged me to use <code>Measure</code> so I did.)</p>","post_number":8,"post_type":1,"posts_count":12,"updated_at":"2024-06-02T22:11:53.446Z","reply_count":0,"reply_to_post_number":5,"quote_count":0,"incoming_link_count":1,"reads":128,"readers_count":127,"score":45.6,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"SLAB-Mr.Thomas","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":11822,"username":"msoucy","name":"Matt Soucy (he/him)","avatar_template":"/user_avatar/www.chiefdelphi.com/msoucy/{size}/237623_2.png"},"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":24594,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/8","custom_user_title":null,"reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3394685,"name":"Kyle Reeve","username":"kreeve","avatar_template":"/user_avatar/www.chiefdelphi.com/kreeve/{size}/187015_2.png","created_at":"2024-06-03T14:56:04.971Z","cooked":"<aside class="quote no-group" data-username="SLAB-Mr.Thomas" data-post="3" data-topic="467132">
