<p>Looks like you solved it later on, but for charity: measures can’t be instantiated like that. Need to use one of the factories, like <code>Seconds.of(I)</code>.</p>","post_number":9,"post_type":1,"posts_count":12,"updated_at":"2024-06-03T14:56:04.971Z","reply_count":1,"reply_to_post_number":3,"quote_count":1,"incoming_link_count":0,"reads":97,"readers_count":96,"score":24.4,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"Kyle Reeve","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":10385,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/9","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3395012,"name":"SLAB-Mr.Thomas","username":"SLAB-Mr.Thomas","avatar_template":"/user_avatar/www.chiefdelphi.com/slab-mr.thomas/{size}/182153_2.png","created_at":"2024-06-04T02:05:52.967Z","cooked":"<p>You are right. The <code>ArrayList</code> with <code>Seconds.of()</code> worked like this:</p>
<pre><code class="lang-auto">private List&lt;Measure&lt;Time&gt;&gt; myTimes = new ArrayList&lt;&gt;(100);

for (int i = 0; i &lt; 100; i++) {
    myTimes.add(Seconds.of(0.));
}

myTimes.set(37, Milliseconds.of(System.currentTimeMillis()));


for(int i = 0; i &lt; myTimes.size(); i++) {
    System.out.println(i + " " + myTimes.get(i).toLongString());
}
</code></pre>","post_number":10,"post_type":1,"posts_count":12,"updated_at":"2024-06-04T02:05:52.967Z","reply_count":0,"reply_to_post_number":9,"quote_count":0,"incoming_link_count":1,"reads":60,"readers_count":59,"score":17.0,"yours":false,"topic_id":467132,"topic_slug":"how-to-make-an-array-of-measure-time","display_username":"SLAB-Mr.Thomas","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":10385,"username":"kreeve","name":"Kyle Reeve","avatar_template":"/user_avatar/www.chiefdelphi.com/kreeve/{size}/187015_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":24594,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/how-to-make-an-array-of-measure-time/467132/10","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3395061,"name":"usbcd36","username":"usbcd36","avatar_template":"/user_avatar/www.chiefdelphi.com/usbcd36/{size}/2444_2.png","created_at":"2024-06-04T04:05:56.973Z","cooked":"<p>Oh man, this digs up a memory of Effective Java.  Here’s the relevant chapter:</p>
